// src/pages/TravelHistoryPage.tsx
import React, { useState } from 'react';

const TravelHistoryPage: React.FC = () => {
  const [history, setHistory] = useState<any[]>([
    // Exemplo de dados de histórico
    {
      id: 1,
      date: '2024-11-01 10:00',
      driver: 'Homer Simpson',
      origin: 'Rua 1',
      destination: 'Rua 2',
      distance: '10 km',
      duration: '20 min',
      value: 'R$ 25,00',
    },
    {
      id: 2,
      date: '2024-11-01 11:30',
      driver: 'James Bond',
      origin: 'Rua 3',
      destination: 'Rua 4',
      distance: '15 km',
      duration: '30 min',
      value: 'R$ 45,00',
    },
  ]);

  return (
    <div>
      <h1>Histórico de Viagens</h1>
      <ul>
        {history.map((ride) => (
          <li key={ride.id}>
            <p>Data: {ride.date}</p>
            <p>Motorista: {ride.driver}</p>
            <p>Origem: {ride.origin}</p>
            <p>Destino: {ride.destination}</p>
            <p>Distância: {ride.distance}</p>
            <p>Duração: {ride.duration}</p>
            <p>Valor: {ride.value}</p>
          </li>
        ))}
      </ul>
    </div>
  );
};

export default TravelHistoryPage;
